import React from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <div class="topnav">
      <Link to="/mainhome">
        <a class="active" href="#home">
          Home
        </a>
      </Link>
      <Link to=""><a href="#news">Add Users</a></Link>
      <Link><a href="#contact">User Details</a></Link>
      <Link><a href="#about">About</a></Link>
    </div>
  );
}

export default Navbar;
